import React from "react";
import Button from "react-bootstrap/Button";
import { useNavigate } from "react-router-dom";
function RegisterdUserData() {
  const navigate = useNavigate();
  let allData;
  const data = localStorage.getItem("Reister-user");
  allData = JSON.parse(data);
  //  console.log(allData.name);
  const handleClick = () => {
    navigate("/");
  };
  return (
    <div
      style={{
        background: "#0064804d",
        width: "50%",
        marginLeft: "20%",
        marginTop: "5%",
      }}
    >
      <Button variant="info" onClick={handleClick} style={{ margin: "10px" }}>
        Home
      </Button>
      <h1 style={{ textAlign: "center" }}>User Details:</h1>
      {allData.map((item) => {

        <>
        console.log(item.name)
          <hr></hr>
          <h3>Name: - {item.name}</h3>
          <h3>Mobile: - {item.mobile}</h3>
          <h3>Email: - {item.email}</h3>
          <h3>Password: - {item.password}</h3>
          <h3>Confirm Password: - {item.ConfirmPassword}</h3>
        </>;
      })}
    </div>
  );
}

export default RegisterdUserData;
